import React, { Component } from 'react'
import { ContentDiv, Content} from '../styles/SideBarStyles'

export class TodoStacks extends Component {

    componentDidUpdate = () =>{
        var names = this.props.entries.name;
        var todoName = names[names.len-1]
    return (<Content key={this.props.entries.key} >{todoName}</Content>)
    }
    
    render() {
        return (
            <React.Fragment>
                <ContentDiv>
                    {this.props.componentDidUpdate}
                </ContentDiv>
            </React.Fragment>
        )
    }
}

export default TodoStacks
